# Given a 2D board containing 'X' and 'O', capture all regions surrounded
# by 'X'.

# A region is captured by flipping all 'O's into 'X's in that surrounded
# region .

# For example,
# X X X X
# X O O X
# X X O X
# X O X X
# After running your function, the board should be:

# X X X X
# X X X X
# X X X X
# X O X X
import collections 

class Solution:
    # @param board, a 9x9 2D array
    # Capture all regions by modifying the input board in-place.
    # Do not return any value.
    def solve(self, board):
        def bfs(i, j):
            marks = []
            queue = collections.deque()
            queue.append((i,j))
            visited[i][j] = True
            flag = True
            while len(queue) > 0:
                ii, jj = queue.popleft()
                if board[ii][jj] == 'X':
                    continue
                else:
                    marks.append([ii,jj])
                d = [(ii + 1, jj), (ii - 1, jj), (ii, jj + 1), (ii, jj - 1)]
                for row, col in d:
                    if row < 0 or row >= n or col < 0 or col >= m:
                        flag = False
                        continue
                    if not visited[row][col]:
                        visited[row][col] = True
                        queue.append((row, col))
            if flag: 
                for row, col in marks: 
                    board[row][col] = 'X'

        n = len(board)
        if n == 0: return
        m = len(board[0])
        visited = [[False] * m for _ in range(n)]
        surroundCount = [0]
        for i in range(n):
            for j in range(m):
                if not visited[i][j]:
                    bfs(i, j)

sol = Solution()
